import "./App.css";
import Timetable from "./Component/Timetable/Timetable";
let MONDAY = [
  { id: "1", sub: "CS301" },
  { id: "2", sub: "  " },
  { id: "3", sub: "CS303" },
  { id: "4", sub: "IT301" },
  { id: "5", sub: "CS363-LAB" },
  { id: "6", sub: "CS363-LAB" },

  { id: "7", sub: "CS363-LAB" },
  { id: "8", sub: " " },
];
const App = () => {
  return (
    <div>
      <Timetable day={MONDAY} />
    </div>
  );
};

export default App;
